    "2013-09-23T17:03:46.458499",nt"name": "tiger-line-shapefile-2013-series-information-file-for-the-primary-roads-national-sha",nt"isopen":
    true,nt"url": null,nt"notes": "The TIGER/Line shapefiles and related database
    files (.dbf) are an extract of selected geographic and cartographic information
    from the U.S. Census Bureau's Master Address File / Topologically Integrated Geographic
    Encoding and Referencing (MAF/TIGER) Database (MTDB).  The MTDB represents a seamless
    national file with no overlaps or gaps between parts, however, each TIGER/Line shapefile
    is designed to stand alone as an independent data set, or they can be combined to
    cover the entire nation.  Primary roads are generally divided, limited-access highways
    within the interstate highway system or under State management, and are distinguished
    by the presence of interchanges.  These highways are accessible by ramps and may
    include some toll highways.  The MAF/TIGER Feature Classification Code (MTFCC) is
    S1100 for primary roads.",nt"license_title": "Creative Commons Attribution",nt"extras":
